import React from "react";

const ContactForm = () => {
  const handleSubmit = (e) => {
    e.preventDefault();
    // Add form submission logic here
  };

  return (
    <div className="contact-form">
        <h2>Contact Me</h2>
        <form onSubmit={handleSubmit}></form>
    </div>
  );
};

export default ContactForm;
